import React from "react"
import Input from './input'
import Checkbox from './checkbox'
import Textarea from './textarea'
import Select from './select'
import Button from './button'

class MyFormItem extends React.Component{
    constructor(props){
        super(props);

        }
        
    render() {        
        if (this.props.item.type === "input")
            {
                return <Input 
                    classname={this.props.item.ClassName}
                    inputType={this.props.item.InputType}
                    title={this.props.item.Labeltitle}
                    name={this.props.item.labelname}
                    value={this.props.item.InputValue}
                    placeholder={this.props.item.Placeholder}
                    // handleChange={this.handleFullName}
                />
            }
        else if (this.props.item.type === "textarea")
            { 
                return <Textarea 
                    classname={this.props.item.ClassName}
                    inputType={this.props.item.InputType}
                    title={this.props.item.Labeltitle}
                    name={this.props.item.labelname}
                    value={this.props.item.InputValue}
                    rows={this.props.item.Row}
                    placeholder={this.props.item.Placeholder}
                    // handleChange={this.handleFullName}
                />
            }
}}
export default MyFormItem
